		email={robots[i].email}
		number={robots[i].number}
		depart={robots[i].depart} 
		arrive={robots[i].arrive}
		prix={robots[i].prix}
		date={robots[i].date}
		hd={robots[i].heureDepart}
		ha={robots[i].heureArrivee}
		onPayment={onPayment}/>
	})



 if(route==='home')
{
	return (

		<div>
	
  {Cardcomponent1};
    </div>);
 }  
 else if(route==='payee')
 	{return
 	 <div>
{Cardcomponent2};
 	 </div>
 	} 

}

export default Cardlist;
